// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// id , email, company, project id

contract UserManager {
    struct User {
        uint256 id;
        string email;
    }

    struct UserProfile {
        uint256 id;
        User user;
        uint256[] friends;
        string img;
        uint256 company;
        uint256[] projects;
    }

    mapping(uint256 => UserProfile) public userProfiles;
    uint256 public profileCount;

    event UserProfileAdded(uint256 id, User user, uint256[] friends, string img, uint256 company, uint256[] projects);

    function addUserProfile(
        string memory _email,
        uint256[] memory _friends,
        string memory _img,
        uint256 _company,
        uint256[] memory _projects
    ) public {
        profileCount++;
        User memory newUser = User(profileCount, _email);
        userProfiles[profileCount] = UserProfile(profileCount, newUser, _friends, _img, _company, _projects);
        emit UserProfileAdded(profileCount, newUser, _friends, _img, _company, _projects);
    }

    function getUserProfile(uint256 _id) public view returns (UserProfile memory) {
        require(_id <= profileCount && _id > 0, "Invalid user profile ID.");
        return userProfiles[_id];
    }
}
